import React from 'react'
import{Link} from 'react-browser-router'
const Gallary = () => {
    return (
        <div className="circle-container">
            <Link path ='/plants' className="cirle-catagory one">Flora</Link>
            <div className="cirle-catagory two">Humananity</div>
            <div className="cirle-catagory three">Mother Earth</div>
            <div className="cirle-catagory four">Little Critters</div>
        </div>
    )
}
export default Gallary
